css:
@keyframes bracket-animation {
  from {
    border-color: #a2a2a2;
  }
  40% {
    border-color: rgba(85, 85, 85, 0.615);
  }
  to {
    border-color: rgba(85, 85, 85, 0.45);
  }
}
atom-text-editor.editor .bracket-matcher .region {
  animation: bracket-animation 0.85s;
  border: 1px solid rgba(85, 85, 85, 0.45);
}
